import Button from "../elements/Button";

const Buttons = ({ whichStep, setWhichStep }) => {
  console.log("whichStep:", whichStep);

  return (
    <>
      {whichStep > 1 ? (
        <Button {...{ buttonText: "Previous", whichStep: whichStep - 1 }} />
      ) : null}
      <Button
        {...{ setWhichStep, buttonText: "Next", whichStep: whichStep + 1 }}
      />
    </>
  );
};

export default Buttons;
